import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';

class Pizza extends React.Component {
    render() {
        <div>
            <h3>This is a React Component!</h3>
            <p>Am some sample text ha !</p>
        </div>
    }
}

ReactDOM.render(
